class Solution {
public:
    vector<int> findAnagrams(string s, string p) {
        vector<int> res;
        int pl = p.size();
        if(s.size()==0 || pl>s.size()) return res;
        int count = 0;
        map<char, int> dict;
        for(char c:p){
            dict[c]++;
        }
        map<char, int> temp(dict);
        int j=0;
        // "aaaaaaaa"
        // "aa"
        for(int i=0; i<s.size(); ++i){
            if(temp.count(s[i])>0){
                if(temp[s[i]]==1){
                    count++;
                    temp[s[i]]--;
                }
                else if(temp[s[i]]==0){
                    temp[s[i]]--;
                    count--;
                }
                else{
                    temp[s[i]]--;
                }
                if(i-j>=pl){
                    if(temp.count(s[j])>0){
                        if(temp[s[j]]==0){
                            count--;
                        }
                        if(++temp[s[j]]==0) count++;
                    }
                    ++j;
                }
                if(count==dict.size()){
                    res.push_back(i-pl+1);
                    count--;
                    temp[s[i-pl+1]]++;
                    ++j;
                }
            }
            else{
                temp = dict;
                count = 0;
                j = i+1;
            }
        }
        return res;
    }
};
